import logo from './logo.svg';
import { BrowserRouter as Router, Route, Routes, Link }  from "react-router-dom";
import './App.css';
import Main from './Component/Main';

function App() {
  return (
    <div className="App">
    <Router>
      <Routes>
      <Route path="/" element={<Main/>}/>
      </Routes>
      </Router>
  </div>
  );
}

export default App;
